import React from 'react';
import { Link } from 'react-router-dom'; // Importă Link din react-router-dom
import '../styles/Header.css'; // Asigură-te că calea către fișierul CSS este corectă

function Header() {
  return (
    <header className="header">
      <Link to="/" className="logo-link"> {/* Folosim Link pentru a face titlul JavaVerse clicabil */}
        <h1>JavaVerse</h1>
      </Link>
      <nav className="nav">
        <Link to="/login">
          <button>Login</button>
        </Link>
        <Link to="/register"> {/* Modificăm /signup în /register */}
          <button>Register</button> {/* Modificăm "Sign Up" în "Register" */}
        </Link>
      </nav>
    </header>
  );
}

export default Header;
